public abstract class BankStaff extends Person {
    protected int empNo;

    public BankStaff(String firstName, String lastName, String address, LocalDate dob, int empNo) {
        super(firstName, lastName, address, dob);
        this.empNo = empNo;
    }

    public int getEmpNo() {
        return empNo;
    }
}

public class CurrentAccount extends Account {
    private static double AIR = 0.005;
    private double overdraft;

    public CurrentAccount(int id, int custNo, double overdraft) {
        super(id, custNo);
        this.overdraft = overdraft;
    }

    @Override
    public boolean withdraw(double amount) {
        if (amount > balance + overdraft) {
            return false;
        }
        balance -= amount;
        return true;
    }

    public double getOverdraft() {
        return overdraft;
    }

    public void setOverdraft(double overdraft) {
        this.overdraft = overdraft;
    }

    public static void setAIR(double newAIR) {
        AIR = newAIR;
    }

    public static double getAIR() {
        return AIR;
    }
}

import java.time.LocalDate;

public class Customer extends Person {
